import React from "react";

import config from '../../config';

function Page(props) {
    console.log('props', props)
    return (
        <p>here</p>
    )
  }

  // This gets called on every request
  export async function getServerSideProps(ctx) {
    return { data: "Hello World" }
  }

  export default Page
